import React from 'react';

class Navbar extends React.Component {
   constructor(props) {
      super(props);
   }

   render(){
      return(
         <div class="navbar">
            <button onClick={this.props.toggleMobileView()} type="button" id="openContactButton"></button>
         </div>
      );
   }
}
export default Navbar;
